import React from 'react'
import { Link } from 'react-router-dom';
import './Calculadora.css'
import Button from './Boton'

class Home extends React.Component {
    render() {
        return (
            <div id="calculadora">
                
                <Link to="/Portales"><div onClick={this.onClick} className="menu__res-li"><Button name="Enlazar Portales"/></div></Link>
                <Link to="/RestBlocks"><div onClick={this.onClick} className="menu__res-li"><Button name="Distancias"/></div></Link>
                <Link to="/Circulos"><div onClick={this.onClick} className="menu__res-li"><Button name="Circulos(en sesarro)"/></div></Link>
            </div>
        )
    }
}


export default Home;
